import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Intro from './c/intro';
import App from './app';

const Main = () => {
    return (
        <Switch>
            <Route exact path="/" component={Intro} />
            <Route path="/App" component={App} />
            {/* Add more routes here if needed */}
        </Switch>
    );
};

export default Main;
